  [],\n\t\"revision_timestamp\": \"2016-07-27T23:02:52.772940\",\n\t\"name\": \"capture-of-gray-wolves-in-the-kanuti-refuge-initiation-of-a-five-year-study\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Fourteen wolves in 5 packs were captured
  and fitted with radio-collars in or near the Kanuti National Wildlife Refuge between
  18 and 21 March 1990. There may be as many as 5 more packs using all or part of
  the refuge. Average pack sizes observed were only half of the estimated average
  size of packs in March 1989. An estimated minimum 31% of the (pre-hunt) population
  of wolves was harvested in March 1989. In 1990, there was no evidence of wolf hunting
  during the capture effort.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
